import React from 'react'

const Submeta = () => {
  return (
    <div className='container'>
      <p className='display-6 mt-4'><strong>Submeta seu trabalho</strong></p>
      <p>Para submeter seu trabalho, você deve estar inscrito como ouvinte</p>
      <p>Se ainda não se inscreveu, <a href="/inscrições">clique aqui</a> para se inscrever.</p>
    </div>
  )
}

export default Submeta
